import React, {Component} from 'react';
import './App.css';
import {BrowserRouter as Router, Route, Switch, NavLink, Redirect} from 'react-router-dom';


//Pages
import MainPage from './pages';



function App() {
  return (
    <Router>
      <Route path="/UploadContent" component={MainPage} />
    </Router>
  );
}

export default App;


